INSERT INTO `translate_cms` (`id`, `page_id`, `lang_code`, `title`, `description`, `meta_title`, `meta_keyword`, `meta_description`) VALUES
(1,	1,	'EN',	'About Us',	'<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.</p>',	'About',	'About Us',	'About Us'),
(2,	1,	'AR',	'معلومات عنا',	'<p>خلافًا للاعتقاد السائد ، فإن Lorem Ipsum ليس مجرد نص عشوائي. لها جذور في قطعة من الأدب اللاتيني الكلاسيكي من 45 قبل الميلاد ، مما يجعلها أكثر من 2000 سنة. بحث ريتشارد مكلينتوك ، وهو أستاذ لاتيني في كلية هامبدن سيدني في فرجينيا ، عن واحدة من أكثر الكلمات اللاتينية غموضًا ، كونسيتيتور ، من ممر لوريم إبسوم ، وتمر عبر الاستشهادات للكلمة في الأدب الكلاسيكي ، واكتشف المصدر الذي لا شك فيه. يأتي Lorem Ipsum من القسمين 1.10.32 و 1.10.33 من كتاب &quot;Finibus Bonorum et Malorum&quot; (قصور الخير والشر) للكاتب شيشرون ، الذي كتب عام 45 قبل الميلاد. هذا الكتاب هو أطروحة عن نظرية الأخلاق ، وشعبية للغاية خلال عصر النهضة. يأتي السطر الأول من Lorem Ipsum ، &quot;Lorem ipsum dolor sit amet ..&quot; ، من سطر في القسم 1.10.32.</p>',	'معلومات عنا',	'معلومات عنا',	'معلومات عنا'),
